import { StyleSheet } from 'react-native';
import { theme } from '../../global/styles/theme';

export const styles = StyleSheet.create({
    container: {
        width: '75%',
        height: 1,
        backgroundColor: theme.colors.secondary30,
        marginVertical: 21,
        marginTop: 2,
        alignSelf: 'flex-end',
    }
})
